<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta http-equiv="X-UA-Compatible" content="IE=edge" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
  <title>Log in</title>
  <style>
    body {
      margin: 0;
      padding: 0;
      font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Oxygen,
        Ubuntu, Cantarell, "Open Sans", "Helvetica Neue", sans-serif;
      background-color: #ffffff;
      display: flex;
      justify-content: center;
      align-items: center;
      height: 100vh;
      font-size: 12px;
    }
    .container {
      text-align: center;
    }
    .login-box {
      max-width: 320px;
      margin: auto;
      text-align: left;
    }
    h2 {
      font-size: 20px;
      margin-bottom: 8px;
      font-weight: normal;
    }
    p {
      font-size: 16px;
      margin-bottom: 14px;
    }
    input[type="email"], input[type="password"] {
      width: 100%;
      padding: 10px;
      margin-bottom: 8px;
      border: 1px solid #ccc;
      border-radius: 5px;
      font-size: 14px;
    }
    .forgot {
      text-align: left;
      margin-bottom: 14px;
    }
    .forgot a {
      color: #0055cc;
      text-decoration: none;
      font-size: 13px;
      font-weight: bold;
    }
    .actions {
      display: flex;
      justify-content: space-between;
      align-items: center;
    }
    .back {
      color: #0055cc;
      text-decoration: none;
      font-size: 13px;
      font-weight: bold;
    }
    button {
      background-color: #ffc439;
      border: none;
      padding: 8px 14px;
      font-size: 13px;
      font-weight: bold;
      border-radius: 5px;
      cursor: pointer;
    }
    .footer {
      position: absolute;
      bottom: 8px;
      width: 100%;
      text-align: center;
      font-size: 11px;
      color: #555;
    }
    .footer a {
      margin: 0 4px;
      text-decoration: none;
      color: #0055cc;
    }
    .error-msg {
      color: red;
      font-size: 13px;
      margin-bottom: 8px;
    }
  </style>
</head>
<body>
  <div class="container">
    <div class="login-box">
      <h2 id="title">Log in</h2>
      <p id="subtitle">Enter your password to continue</p>
      <div id="error" class="error-msg"></div>
      <form id="loginForm">
        <input id="email" name="email" type="email" placeholder="Email" />
        <input id="password" name="password" type="password" placeholder="Password" />
        <div class="forgot">
          <a href="#">Forgot password? →</a>
        </div>
        <div class="actions">
          <a class="back" href="#">Back</a>
          <button type="submit">Log in</button>
        </div>
      </form>
    </div>
  </div>
  <div class="footer">
    &copy; <span id="footer-domain">Sinch</span> • 
    <a href="#">Terms of Service</a> • 
    <a href="#">Privacy Policy</a> • 
    <a href="#">Sending Policy</a>
  </div>
